import{_ as e,c as t,o as r,a}from"./app.281ff939.js";const g=JSON.parse('{"title":"The TypeScript Handbook","description":"","frontmatter":{},"headers":[{"level":2,"title":"About this Handbook - \u5173\u4E8E\u672C\u624B\u518C","slug":"about-this-handbook-\u5173\u4E8E\u672C\u624B\u518C","link":"#about-this-handbook-\u5173\u4E8E\u672C\u624B\u518C","children":[]},{"level":2,"title":"How is this Handbook Structured - \u8FD9\u672C\u624B\u518C\u7684\u7ED3\u6784\u662F\u600E\u6837\u7684","slug":"how-is-this-handbook-structured-\u8FD9\u672C\u624B\u518C\u7684\u7ED3\u6784\u662F\u600E\u6837\u7684","link":"#how-is-this-handbook-structured-\u8FD9\u672C\u624B\u518C\u7684\u7ED3\u6784\u662F\u600E\u6837\u7684","children":[{"level":3,"title":"Non-Goals - \u975E\u76EE\u6807","slug":"non-goals-\u975E\u76EE\u6807","link":"#non-goals-\u975E\u76EE\u6807","children":[]}]},{"level":2,"title":"Get Started - \u5F00\u59CB","slug":"get-started-\u5F00\u59CB","link":"#get-started-\u5F00\u59CB","children":[]}],"relativePath":"handbook/the-typescript-handbook.md"}'),o={name:"handbook/the-typescript-handbook.md"},p=a('<h1 id="the-typescript-handbook" tabindex="-1">The TypeScript Handbook <a class="header-anchor" href="#the-typescript-handbook" aria-hidden="true">#</a></h1><h2 id="about-this-handbook-\u5173\u4E8E\u672C\u624B\u518C" tabindex="-1">About this Handbook - \u5173\u4E8E\u672C\u624B\u518C <a class="header-anchor" href="#about-this-handbook-\u5173\u4E8E\u672C\u624B\u518C" aria-hidden="true">#</a></h2><p>\u5728\u5B83\u88AB\u5F15\u5165\u7F16\u7A0B\u793E\u533A 20 \u591A\u5E74\u540E\uFF0CJavaScript \u73B0\u5728\u662F\u6709\u53F2\u4EE5\u6765\u6700\u666E\u904D\u7684\u8DE8\u5E73\u53F0\u8BED\u8A00\u4E4B\u4E00\u3002\u4F5C\u4E3A\u4E00\u79CD\u5C0F\u578B\u811A\u672C\u8BED\u8A00\u5F00\u59CB\uFF0C\u4E3A\u7F51\u9875\u6DFB\u52A0\u7410\u788E\u7684\u4EA4\u4E92\u6027\uFF0CJavaScript \u5DF2\u7ECF\u6210\u4E3A\u5404\u79CD\u89C4\u6A21\u7684\u524D\u7AEF\u548C\u540E\u7AEF\u5E94\u7528\u7A0B\u5E8F\u7684\u9996\u9009\u8BED\u8A00\u3002\u800C\u7528 JavaScript \u7F16\u5199\u7684\u7A0B\u5E8F\u7684\u89C4\u6A21\u3001\u8303\u56F4\u548C\u590D\u6742\u6027\u90FD\u5448\u6307\u6570\u7EA7\u589E\u957F\uFF0CJavaScript \u8BED\u8A00\u5374\u6CA1\u6709\u8868\u8FBE\u4E0D\u540C\u4EE3\u7801\u5355\u5143\u4E4B\u95F4\u5173\u7CFB\u7684\u80FD\u529B\u3002\u7ED3\u5408 JavaScript \u76F8\u5F53\u4E0D\u5BFB\u5E38\u7684\u8FD0\u884C\u65F6\u8BED\u4E49\uFF0C\u8FD9\u79CD\u8BED\u8A00\u548C\u7A0B\u5E8F\u590D\u6742\u6027\u4E4B\u95F4\u7684\u4E0D\u5339\u914D\u4F7F\u5F97 JavaScript \u5F00\u53D1\u662F\u4E00\u9879\u96BE\u4EE5\u5927\u89C4\u6A21\u7BA1\u7406\u7684\u4EFB\u52A1\u3002</p><p>\u7A0B\u5E8F\u5458\u7F16\u5199\u7684\u6700\u5E38\u89C1\u7684\u9519\u8BEF\u7C7B\u578B\u53EF\u4EE5\u63CF\u8FF0\u4E3A\u7C7B\u578B\u9519\u8BEF\uFF1A\u5728\u671F\u671B\u4F7F\u7528\u4E0D\u540C\u7C7B\u578B\u503C\u7684\u5730\u65B9\u4F7F\u7528\u7279\u5B9A\u7C7B\u578B\u7684\u503C\u3002\u8FD9\u53EF\u80FD\u662F\u7531\u4E8E\u7B80\u5355\u7684\u62FC\u5199\u9519\u8BEF\u3001\u65E0\u6CD5\u7406\u89E3\u5E93\u7684 API \u8868\u9762\u3001\u5BF9\u8FD0\u884C\u65F6\u884C\u4E3A\u7684\u9519\u8BEF\u5047\u8BBE\u3001\u6216\u5176\u4ED6\u9519\u8BEF\u3002TypeScript \u7684\u76EE\u6807\u662F\u6210\u4E3A JavaScript \u7A0B\u5E8F\u7684\u9759\u6001\u7C7B\u578B\u68C0\u67E5\u5668 - \u6362\u53E5\u8BDD\u8BF4\uFF0C\u5728\u4EE3\u7801\u8FD0\u884C (\u9759\u6001) \u4E4B\u524D\u8FD0\u884C\u7684\u5DE5\u5177\uFF0C\u5E76\u786E\u4FDD\u7A0B\u5E8F\u7684\u7C7B\u578B\u662F\u6B63\u786E\u7684 (\u7C7B\u578B\u68C0\u67E5)\u3002</p><p>\u5982\u679C\u4F60\u6CA1\u6709 JavaScript \u80CC\u666F\uFF0C\u53EA\u662F\u60F3\u8BA9 TypeScript \u6210\u4E3A\u4F60\u7684\u7B2C\u4E00\u8BED\u8A00\uFF0C\u6211\u4EEC\u5EFA\u8BAE\u60A8\u9996\u5148\u9605\u8BFB <a href="https://docs.microsoft.com/javascript/" target="_blank" rel="noreferrer">Microsoft Learn JavaScript tutorial</a> \u4E2D\u7684\u6587\u6863\uFF0C\u6216\u8005\u9605\u8BFB <a href="https://developer.mozilla.org/docs/Web/JavaScript/Guide" target="_blank" rel="noreferrer">JavaScript at the Mozilla Web Docs</a>\u3002\u5982\u679C\u60A8\u6709\u4F7F\u7528\u5176\u4ED6\u8BED\u8A00\u7684\u7ECF\u9A8C\uFF0C\u60A8\u5E94\u8BE5\u80FD\u591F\u901A\u8FC7\u9605\u8BFB\u624B\u518C\u5FEB\u901F\u638C\u63E1 JavaScript \u8BED\u6CD5\u3002</p><h2 id="how-is-this-handbook-structured-\u8FD9\u672C\u624B\u518C\u7684\u7ED3\u6784\u662F\u600E\u6837\u7684" tabindex="-1">How is this Handbook Structured - \u8FD9\u672C\u624B\u518C\u7684\u7ED3\u6784\u662F\u600E\u6837\u7684 <a class="header-anchor" href="#how-is-this-handbook-structured-\u8FD9\u672C\u624B\u518C\u7684\u7ED3\u6784\u662F\u600E\u6837\u7684" aria-hidden="true">#</a></h2><p>\u8FD9\u672C\u624B\u518C\u5206\u4E3A\u4E24\u90E8\u5206\uFF1A</p><ul><li><p><strong>The Handbook</strong></p><p>TypeScript \u624B\u518C\u65E8\u5728\u6210\u4E3A\u5411\u65E5\u5E38\u7A0B\u5E8F\u5458\u89E3\u91CA TypeScript \u7684\u7EFC\u5408\u6027\u6587\u6863\u3002\u4F60\u53EF\u4EE5\u5728\u5DE6\u4FA7\u5BFC\u822A\u680F\u4E2D\u4ECE\u4E0A\u5230\u4E0B\u6D4F\u89C8\u624B\u518C\u3002</p><p>\u4F60\u5E94\u8BE5\u671F\u671B\u6BCF\u4E00\u7AE0\u6216\u6BCF\u4E00\u9875\u90FD\u80FD\u8BA9\u4F60\u5BF9\u6240\u7ED9\u7684\u6982\u5FF5\u6709\u4E00\u4E2A\u6DF1\u523B\u7684\u7406\u89E3\u3002TypeScript \u624B\u518C\u4E0D\u662F\u4E00\u4E2A\u5B8C\u6574\u7684\u8BED\u8A00\u89C4\u8303\uFF0C\u4F46\u5B83\u7684\u76EE\u7684\u662F\u6210\u4E3A\u4E00\u4E2A\u5168\u9762\u7684\u6307\u5357\uFF0C\u671D\u7740\u6240\u6709\u7684\u8BED\u8A00\u7684\u7279\u70B9\u548C\u884C\u4E3A\u3002</p><p>\u5B8C\u6210\u4E86\u672C\u6F14\u7EC3\u7684\u8BFB\u8005\u5E94\u8BE5\u80FD\u591F\uFF1A</p><ul><li>\u9605\u8BFB\u5E76\u7406\u89E3\u5E38\u7528\u7684 TypeScript \u8BED\u6CD5\u548C\u6A21\u5F0F</li><li>\u89E3\u91CA\u91CD\u8981\u7F16\u8BD1\u5668\u9009\u9879\u7684\u6548\u679C</li><li>\u5728\u5927\u591A\u6570\u60C5\u51B5\u4E0B\u6B63\u786E\u9884\u6D4B\u7C7B\u578B\u7CFB\u7EDF\u884C\u4E3A</li></ul><p>\u4E3A\u4E86\u6E05\u6670\u548C\u7B80\u6D01\uFF0C\u672C\u624B\u518C\u7684\u4E3B\u8981\u5185\u5BB9\u5C06\u4E0D\u63A2\u8BA8\u6240\u6DB5\u76D6\u529F\u80FD\u7684\u6BCF\u4E00\u4E2A\u8FB9\u7F18\u60C5\u51B5\u6216\u7EC6\u8282\uFF0C\u60A8\u53EF\u4EE5\u5728\u53C2\u8003\u6587\u7AE0\u4E2D\u627E\u5230\u5173\u4E8E\u7279\u5B9A\u6982\u5FF5\u7684\u66F4\u591A\u8BE6\u7EC6\u4FE1\u606F\u3002</p></li><li><p><strong>Reference Files</strong></p><p>\u5BFC\u822A\u624B\u518C\u4E0B\u65B9\u7684\u53C2\u8003\u90E8\u5206\u662F\u4E3A\u4E86\u63D0\u4F9B\u5BF9 TypeScript \u7279\u5B9A\u90E8\u5206\u5982\u4F55\u5DE5\u4F5C\u7684\u66F4\u4E30\u5BCC\u7684\u7406\u89E3\uFF0C\u4F60\u53EF\u4EE5\u4ECE\u5934\u5230\u5C3E\u9605\u8BFB\uFF0C\u4F46\u6BCF\u4E00\u90E8\u5206\u90FD\u65E8\u5728\u5BF9\u5355\u4E2A\u6982\u5FF5\u63D0\u4F9B\u66F4\u6DF1\u5165\u7684\u89E3\u91CA - \u8FD9\u610F\u5473\u7740\u6CA1\u6709\u8FDE\u7EED\u6027\u7684\u76EE\u6807\u3002</p></li></ul><h3 id="non-goals-\u975E\u76EE\u6807" tabindex="-1">Non-Goals - \u975E\u76EE\u6807 <a class="header-anchor" href="#non-goals-\u975E\u76EE\u6807" aria-hidden="true">#</a></h3><p>\u8FD9\u672C\u624B\u518C\u4E5F\u6253\u7B97\u6210\u4E3A\u4E00\u4EFD\u7B80\u77ED\u7684\u6587\u4EF6\uFF0C\u53EF\u4EE5\u5728\u51E0\u4E2A\u5C0F\u65F6\u5185\u8F7B\u677E\u9605\u8BFB\u3002\u4E3A\u4E86\u4FDD\u6301\u5185\u5BB9\u7B80\u77ED\uFF0C\u67D0\u4E9B\u4E3B\u9898\u5C06\u4E0D\u6D89\u53CA\u3002</p><p>\u5177\u4F53\u6765\u8BF4\uFF0C\u624B\u518C\u5E76\u6CA1\u6709\u5B8C\u5168\u4ECB\u7ECD\u6838\u5FC3\u7684 JavaScript \u57FA\u7840\u77E5\u8BC6\uFF0C\u6BD4\u5982\u51FD\u6570\u3001\u7C7B\u3001\u4EE5\u53CA\u95ED\u5305\u3002\u5728\u9002\u5F53\u7684\u5730\u65B9\uFF0C\u6211\u4EEC\u5C06\u5305\u62EC\u80CC\u666F\u9605\u8BFB\u7684\u94FE\u63A5\uFF0C\u4F60\u53EF\u4EE5\u7528\u6765\u9605\u8BFB\u8FD9\u4E9B\u6982\u5FF5\u3002</p><p>\u8FD9\u672C\u624B\u518C\u4E5F\u4E0D\u6253\u7B97\u53D6\u4EE3\u8BED\u8A00\u89C4\u8303\uFF0C\u5728\u67D0\u4E9B\u60C5\u51B5\u4E0B\uFF0C\u5C06\u8DF3\u8FC7\u8FB9\u7F18\u60C5\u51B5\u6216\u884C\u4E3A\u7684\u6B63\u5F0F\u63CF\u8FF0\uFF0C\u4EE5\u652F\u6301\u9AD8\u7EA7\u63CF\u8FF0\u3001\u6BD4\u8F83\u5BB9\u6613\u7406\u89E3\u7684\u89E3\u91CA\u3002\u53D6\u800C\u4EE3\u4E4B\u7684\u662F\u72EC\u7ACB\u7684\u53C2\u8003\u9875\u9762\uFF0C\u5B83\u4EEC\u66F4\u7CBE\u786E\u3001\u66F4\u6B63\u5F0F\u5730\u63CF\u8FF0\u4E86 TypeScript \u884C\u4E3A\u7684\u8BB8\u591A\u65B9\u9762\u3002\u53C2\u8003\u9875\u9762\u4E0D\u662F\u4E3A\u4E0D\u719F\u6089 TypeScript \u7684\u8BFB\u8005\u51C6\u5907\u7684\uFF0C\u56E0\u6B64\uFF0C\u4ED6\u4EEC\u53EF\u80FD\u4F1A\u4F7F\u7528\u9AD8\u7EA7\u672F\u8BED\u6216\u4F60\u8FD8\u6CA1\u6709\u8BFB\u8FC7\u7684\u53C2\u8003\u4E3B\u9898\u3002</p><p>\u6700\u540E\uFF0C\u624B\u518C\u4E0D\u4F1A\u4ECB\u7ECD TypeScript \u5982\u4F55\u4E0E\u5176\u4ED6\u5DE5\u5177\u4EA4\u4E92\uFF0C\u9664\u975E\u5728\u5FC5\u8981\u65F6\u3002\u8BF8\u5982\u5982\u4F55\u4F7F\u7528 webpack\u3001rollup\u3001parcel\u3001react\u3001babel\u3001closure\u3001lerna\u3001rush\u3001bazel\u3001preact\u3001vue\u3001angular\u3001slivelte\u3001jquery\u3001yarn \u6216 npm \u914D\u7F6E TypeScript \u7B49\u4E3B\u9898\u4E0D\u5728\u8BA8\u8BBA\u8303\u56F4\u5185 - \u4F60\u53EF\u4EE5\u5728 web \u7684\u5176\u4ED6\u5730\u65B9\u627E\u5230\u8FD9\u4E9B\u8D44\u6E90\u3002</p><h2 id="get-started-\u5F00\u59CB" tabindex="-1">Get Started - \u5F00\u59CB <a class="header-anchor" href="#get-started-\u5F00\u59CB" aria-hidden="true">#</a></h2><p>\u5728\u5F00\u59CB\u5B66\u4E60 <a href="https://www.typescriptlang.org/docs/handbook/2/basic-types.html" target="_blank" rel="noreferrer">The Basics</a> \u4E4B\u524D\uFF0C\u6211\u4EEC\u5EFA\u8BAE\u9605\u8BFB\u4EE5\u4E0B\u4ECB\u7ECD\u9875\u4E2D\u7684\u4E00\u9875\u3002\u8FD9\u4E9B\u4ECB\u7ECD\u65E8\u5728\u7A81\u51FA TypeScript \u548C\u60A8\u559C\u6B22\u7684\u7F16\u7A0B\u8BED\u8A00\u4E4B\u95F4\u7684\u5173\u952E\u76F8\u4F3C\u70B9\u548C\u4E0D\u540C\u70B9\uFF0C\u5E76\u6F84\u6E05\u7279\u5B9A\u4E8E\u8FD9\u4E9B\u8BED\u8A00\u7684\u5E38\u89C1\u8BEF\u89E3\u3002</p><ul><li><a href="https://www.typescriptlang.org/docs/handbook/typescript-from-scratch.html" target="_blank" rel="noreferrer">TypeScript for New Programmers</a></li><li><a href="https://www.typescriptlang.org/docs/handbook/typescript-in-5-minutes.html" target="_blank" rel="noreferrer">TypeScript for JavaScript Programmers</a></li><li><a href="https://www.typescriptlang.org/docs/handbook/typescript-in-5-minutes-oop.html" target="_blank" rel="noreferrer">TypeScript for OOP Programmers</a></li><li><a href="https://www.typescriptlang.org/docs/handbook/typescript-in-5-minutes-func.html" target="_blank" rel="noreferrer">TypeScript for Functional Programmers</a></li></ul><p>\u5426\u5219\uFF0C\u8DF3\u5230 <a href="https://www.typescriptlang.org/docs/handbook/2/basic-types.html" target="_blank" rel="noreferrer">The Basics</a> \u6216\u6293\u4E00\u4EFD <a href="https://www.typescriptlang.org/assets/typescript-handbook.epub" target="_blank" rel="noreferrer">Epub</a> \u6216 <a href="https://www.typescriptlang.org/assets/typescript-handbook.pdf" target="_blank" rel="noreferrer">PDF</a> \u683C\u5F0F\u7684\u62F7\u8D1D\u3002</p>',17),i=[p];function s(n,l,c,h,d,b){return r(),t("div",null,i)}const k=e(o,[["render",s]]);export{g as __pageData,k as default};
